import React from "react";
import ExpenseItems from "./ExpenseItems";

function ExpensesList(props) {
  let expNotFound = <p> No Expenses found </p>;
  if (props.item.length >= 0) {
    expNotFound = props.items.map((props) => (
      <ExpenseItems
        key={props.id}
        title={props.title}
        amount={props.amount}
        date={props.date}
      />
    ));
  }
}

export default ExpensesList;
